“Macao Maritime Info” is an application, developed by the Marine and Water Bureau of the Macao SAR, which aims to provide maritime information for citizens and tourists via mobile devices. Its main features include:
• Real time sailings – provide information on real time arriving and departing sailings at all ferry terminals;
• Sailing schedule – provide regular sailing schedules of all ferry routes;
• Real time sea conditions - provide camera views showing real time sea conditions in different areas;
• Tides – provide real time tidal heights and allow users to search for predicted tidal heights;
• Notice to mariners – provide the latest navigation information for vessels;
Services at terminals – provide information on shops, ticket office, restaurants and services available in the terminals.

The Transport Department (TD) launched a new version of the "HKeMobility" mobile application. 

It provides a one-stop platform for the public to conveniently search for information including routes of different transportation modes, journey time, transport fares, etc.  and disseminates real-time traffic news to enhance user experience and facilitate public’s mobility. (including walking, driving, taking public transport, etc.).


The key features of “HKeMobility” includes: -

1. More real-time traffic and public transport information (including speed map, parking vacancy and real-time arrival information);

2. Personalised traffic and transport information (including self-setting short cuts, bookmarking for frequently visit public transport stops, car parks, etc.);

3. Walking route search information covers all 18 districts in Hong Kong. The search function also offers barrier-free route options; 

4. Provide elderly mode, to facilitate elderly obtaining traffic and transport information.
